import React from 'react';
import PieChart from 'react-minimal-pie-chart';
import './CycleGraph.css';



class CycleGraph extends React.Component {
    render() {
        return (
            <div className="ui container">
                <PieChart data={[
                    {
                        title: 'One',
                        value: 10,
                        color: '#e3c877'
                    },
                    {
                        title: 'Two',
                        value: 15,
                        color: '#45c176'
                    },
                    {
                        title: 'Three',
                        value: 20,
                        color: '#b02d2c',

                    },
                    {
                        title: 'Four',
                        value: 20,
                        color: '#55b8cc',
                        onmouseover:'asdasdasda'
                    }
                ]}

                          lineWidth={30}
                          paddingAngle={5}
                          lengthAngle={-360}
                          style={{height: '200px'}}

                          label={({ data, dataIndex }) =>
                              Math.round(data[dataIndex].percentage) + '%'
                          }
                          labelStyle={{
                              fontSize: '5px',
                              fontFamily: 'sans-serif'}}
                          labelPosition={60}
                          animate


                />
                <div className="containerTitles">
                    <div><span className="dot yellow"/>One</div>
                    <div><span className="dot green"/>Two</div>
                    <div><span className="dot red"/>Three</div>
                    <div><span className="dot blue"/>Four</div>
                </div>
            </div>
        );
    }
}

export default CycleGraph;
